        await browser.url('/')
        await basicFunctions.docLoaded()
    }
    async getProducts () {
        await basicFunctions.docLoaded()
        await this.products.waitForClickable()
        await this.products.click()
        await basicFunctions.docLoaded()
    }
    async getCart () {
        await basicFunctions.docLoaded()
        await this.cart.waitForClickable()
        await this.cart.click()
        await basicFunctions.docLoaded()
    }
    async getLogin () {
        await basicFunctions.docLoaded()
